package me.whiteship.refactoring._06_mutable_data._23_change_reference_to_value;import static org.assertj.core.api.Assertions.*;import org.junit.jupiter.api.Test;class TelephoneNumberTest {	@Test	void testEquals() {		TelephoneNumber number1 = new TelephoneNumber("123", "1234");		TelephoneNumber number2 = new TelephoneNumber("123", "1234");		assertThat(number1).isEqualTo(number2);	}}